import React from 'react';
import styled from 'styled-components';

const UserListBlock = styled.div`
  width: 30%;
  height: 100%;
  border: 1px solid black;
`;

const UserList = ({ userList }) => {
  return (
    <UserListBlock>
      {userList.map((el) => (
        <div>el</div>
      ))}
    </UserListBlock>
  );
};

export default UserList;
